description:
This is a reproduced torrent of Papakeno's Strange Patterns Collection.


I want to make it abundantly clear that I have not in any form, shape, or way, been involved in the compilation process of these collections - All of the &quot;Blood, sweat and tears&quot; are Papakenos and not mine. If you like the music, then pay your respects to the man here, make a comment. Just say &quot;Thank you, Papakeno&quot; - it's common courtesy to thank for that which is freely given!
Not to mention that a simple &quot;Thank you, Papakeno&quot; will keep the man happy, and  working on these great music compilations for all of us.

For the rest of Papakeno's music (the PapaPop series), check out: &lt;a href=&quot;
http://thepiratebay.se/user/papakeno/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://thepiratebay.se/user/papakeno/&lt;/a&gt; &lt;a href=&quot;
