http://thepiratebay.se/user/The%20Real%20Chicken/&lt;/a&gt;

Also check out the ISOTOP collection, created by _Wintermute_ - Very good music in similar style: &lt;a href=&quot;
http://thepiratebay.se/user/_Wintermute_/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://thepiratebay.se/user/_Wintermute_/&lt;/a&gt;

Torrent contains Strange Patterns 1-9, and EP 1&amp;2.
SP9 and EP 1&amp;2 are complete with the bonus tracks added 2010.


Happy Hunting

The REAL Chicken

PS
I work abroad, therefore I will disappear and re-appear at intervals (usually away 6 weeks, home 6 weeks). So if I'm not seeding right now, just be patient, I will return so you can get it downloaded.
